insert  into `sysglobal_wes`(`sysglobal_wes_id`,`surcharge`,`vat_rate`,`disconnection_duration`,`water_announcement`,`electric_announcement`) values ('global',5.26,12.16,9,'<p>This is your electric bill consumed in the billing period below. Please bring this bill when paying. For inquiries, please contact our Utility Services Office at Tel: (044)796-26-10.</p>\r\n<ul>\r\n<li>To: GR HOMEOWNERS. Please be advised that effective March 2015, garbage collection fee amounting to P80.00 per month will be reflected in your monthly water bill.</li>\r\n<li>To prevent grass fires, please be advised that \"open burning\" of trash on vacant lots will be strictly prohibited. As provided for in R.A.9514or the Fire Code of the Phils., those who will be caught will be subject to fine and prisonment. (Ref. R.A. 9514 IRR, Rule 10, Chapter5).</li>\r\n</ul>','<p>This is your electric bill consumed in the billing period below. Please bring this bill when paying. For inquiries, please contact our Utility Services Office at Tel: (044)796-26-10.</p>');

